import { SRLWrapper } from "simple-react-lightbox";
import '../../../pages/StyleMembers.css';
import nishika from '../../../assets/nishika.jpg';


function Lightbox() {
  return (

    <SRLWrapper>
      <a href={nishika}>
        <img src={nishika} alt="Nishika Patel, the internal vice president of CURIS" className="bigImage"/>
      </a>
      <a href="/link/to/the/full/width/image_two.jpg">
        <img src={nishika} alt="Nishika Patel, the internal vice president of CURIS" className="bigImage"/>
      </a>
      <a href="/link/for/the/full/width/image/image_three.jpg">
        <Image
          src={nishika}
          alt="Picture of the author"
          width={500}
          height={900}
          srl_gallery_image="true" // Add this if your thumbnail is not recognized
        />
      </a>
    </SRLWrapper>
  );
}

export default Lightbox;
